import React from 'react';
import {BrowserRouter,Route, Switch} from 'react-router-dom';
import MainVideoPage from './components/MainVideoPage/MainVideoPage';

function App () {
  let refreshPage = () => {window.location.reload(false);};
  let onClick = () => {onClick={refreshPage}}
  return (
    <BrowserRouter>
        <div className="App">
          <Switch>
            <Route path="/" exact component={MainVideoPage}/>
            {/* <Route path="/:id" component={MainVideoPage}/> */}
            <Route path="/:id"  render = {(props)=> <MainVideoPage refresh={onClick} {...props}/>} />
          </Switch>
        </div>
    </BrowserRouter>
  )
}

export default App;
